import React from 'react';
import { View, Text, StyleSheet, TouchableOpacity } from 'react-native';

const ConnectingForVolunteers = () => {
  return (
    <View style={styles.container}>
      <View style={styles.titleContainer}>
        <Text style={styles.title}>Connecting for volunteers</Text>
      </View>
      <View style={styles.buttonContainer}>
        <TouchableOpacity style={[styles.button, styles.leftButton]}>
          <Text style={[styles.buttonText, styles.leftButtonText]}>Create an account</Text>
        </TouchableOpacity>
        <TouchableOpacity style={[styles.button, styles.rightButton]}>
          <Text style={[styles.buttonText, styles.rightButtonText]}>Login</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  titleContainer: {
    backgroundColor: '#007AFF',
    padding: 10,
    borderRadius: 5,
    marginBottom: 20,
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    color: '#FFFFFF',
  },
  buttonContainer: {
    flexDirection: 'row',
  },
  button: {
    padding: 10,
    borderRadius: 5,
    marginHorizontal: 10,
  },
  leftButton: {
    backgroundColor: '#32CD32',
    borderWidth: 2,
    borderColor: '#32CD32',
  },
  leftButtonText: {
    color: '#F FFFFF',
    fontSize: 18,
    fontWeight: 'bold',
  },
  rightButton: {
    backgroundColor: '#FFFFFF',
    borderWidth: 2,
    borderColor: '#FF0000',
  },
  rightButtonText: {
    color: '#FF0000',
    fontSize: 18,
    fontWeight: 'bold',
  },
});

export default ConnectingForVolunteers;
